import { Card } from "antd";
import React from "react";
import { RetweetOutlined } from "@ant-design/icons";

const PostCard = ({ post }) => {
  return (
    <div>
      <Card
        cover={post.Images[0] && <PostImages images={post.Images} />}
        actions={[<RetweetOutlined />]}
      ></Card>
    </div>
  );
};

export default PostCard;
